// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

import "./ISwapAdapter.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract EmigroRouter is Ownable, ReentrancyGuard {
    constructor() Ownable(msg.sender) {}

    // Pair-based adapter: tokenIn => tokenOut => adapter address
    mapping(address => mapping(address => address)) public adapterForPair;

    // Path-based adapter: keccak256(abi.encode(path)) => adapter
    mapping(bytes32 => address) public adapterForPath;

    // Default deadline if none provided
    uint256 public defaultDeadline = 300;

    // Events
    event AdapterSet(address indexed tokenIn, address indexed tokenOut, address indexed adapter);
    event AdapterPathSet(address[] path, address indexed adapter);
    event SwapPerformed(
        address indexed tokenIn,
        address indexed tokenOut,
        uint256 amountIn,
        uint256 amountOut,
        address indexed adapter,
        address recipient
    );

    // --- Admin ---

    function setAdapterForPair(address tokenIn, address tokenOut, address adapter) external onlyOwner {
        require(adapter != address(0), "Invalid adapter");
        adapterForPair[tokenIn][tokenOut] = adapter;
        emit AdapterSet(tokenIn, tokenOut, adapter);
    }

    function setAdapterForPath(address[] calldata path, address adapter) external onlyOwner {
        require(path.length >= 2, "Invalid path");
        require(adapter != address(0), "Invalid adapter");

        bytes32 pathHash = keccak256(abi.encode(path));
        adapterForPath[pathHash] = adapter;

        emit AdapterPathSet(path, adapter);
    }

    function setDefaultDeadline(uint256 seconds_) external onlyOwner {
        defaultDeadline = seconds_;
    }

    // --- Pair-Based Swap ---

    function swapExactInput(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut,
        address recipient,
        bytes calldata data
    ) external payable nonReentrant returns (uint256 amountOut) {
        address adapter = adapterForPair[tokenIn][tokenOut];
        require(adapter != address(0), "No adapter set for pair");

        _transferTokenIn(tokenIn, adapter, amountIn);
        amountOut = ISwapAdapter(adapter).swapExactInput(
            tokenIn, tokenOut, amountIn, minAmountOut, recipient, data
        );

        emit SwapPerformed(tokenIn, tokenOut, amountIn, amountOut, adapter, recipient);
    }

    function swapExactOutput(
        address tokenIn,
        address tokenOut,
        uint256 maxAmountIn,
        uint256 amountOut,
        address recipient,
        bytes calldata data
    ) external payable nonReentrant returns (uint256 amountInUsed) {
        address adapter = adapterForPair[tokenIn][tokenOut];
        require(adapter != address(0), "No adapter set for pair");

        _transferTokenIn(tokenIn, adapter, maxAmountIn);
        amountInUsed = ISwapAdapter(adapter).swapExactOutput(
            tokenIn, tokenOut, maxAmountIn, amountOut, recipient, data
        );

        emit SwapPerformed(tokenIn, tokenOut, amountInUsed, amountOut, adapter, recipient);
    }

    // --- Path-Based Swap ---

    function swapExactInputPath(
        address[] calldata path,
        uint256 amountIn,
        uint256 minAmountOut,
        address recipient,
        bytes calldata data
    ) external payable nonReentrant returns (uint256 amountOut) {
        require(path.length >= 2, "Invalid path");

        address tokenIn = path[0];
        address tokenOut = path[path.length - 1];
        bytes32 pathHash = keccak256(abi.encode(path));

        address adapter = adapterForPath[pathHash];
        require(adapter != address(0), "No adapter set for path");

        _transferTokenIn(tokenIn, adapter, amountIn);
        amountOut = ISwapAdapter(adapter).swapExactInputPath(path, amountIn, minAmountOut, recipient, data);

        emit SwapPerformed(tokenIn, tokenOut, amountIn, amountOut, adapter, recipient);
    }

    function swapExactOutputPath(
        address[] calldata path,
        uint256 maxAmountIn,
        uint256 amountOut,
        address recipient,
        bytes calldata data
    ) external payable nonReentrant returns (uint256 amountInUsed) {
        require(path.length >= 2, "Invalid path");

        address tokenIn = path[0];
        address tokenOut = path[path.length - 1];
        bytes32 pathHash = keccak256(abi.encode(path));

        address adapter = adapterForPath[pathHash];
        require(adapter != address(0), "No adapter set for path");

        _transferTokenIn(tokenIn, adapter, maxAmountIn);
        amountInUsed = ISwapAdapter(adapter).swapExactOutputPath(path, maxAmountIn, amountOut, recipient, data);

        emit SwapPerformed(tokenIn, tokenOut, amountInUsed, amountOut, adapter, recipient);
    }

    // --- Internal ---

    function _transferTokenIn(address token, address to, uint256 amount) internal {
        if (token == address(0)) {
            require(msg.value == amount, "Incorrect ETH sent");
            (bool success, ) = to.call{value: amount}("");
            require(success, "ETH transfer failed");
        } else {
            IERC20(token).transferFrom(msg.sender, to, amount);
        }
    }

    // Allow receiving ETH
    receive() external payable {}
}

