pragma solidity ^0.8.22;

import "./ISwapAdapter.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface IUniswapV2Router {
    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory);

    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory);
}

contract UniswapV2Adapter is ISwapAdapter {
    using SafeERC20 for IERC20;

    address public immutable router;
    uint256 public constant DEFAULT_DEADLINE = 300;

    constructor(address _router) {
        require(_router != address(0), "Invalid router address");
        router = _router;
    }

    // --- Pair-based ---

    function swapExactInput(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut,
        address recipient,
        bytes calldata /* data */
    ) external override returns (uint256 amountOut) {
        IERC20(tokenIn).approve(router, 0);
        IERC20(tokenIn).approve(router, amountIn);

        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = tokenOut;

        try IUniswapV2Router(router).swapExactTokensForTokens(
            amountIn,
            minAmountOut,
            path,
            recipient,
            block.timestamp + DEFAULT_DEADLINE
        ) returns (uint256[] memory amounts) {
            amountOut = amounts[amounts.length - 1];
        } catch Error(string memory reason) {
            revert(string(abi.encodePacked("Swap failed: ", reason)));
        } catch (bytes memory lowLevelData) {
            revert(string(abi.encodePacked("Swap failed: low-level error ", toHex(lowLevelData))));
        }
    }

    function swapExactOutput(
        address tokenIn,
        address tokenOut,
        uint256 maxAmountIn,
        uint256 amountOut,
        address recipient,
        bytes calldata /* data */
    ) external override returns (uint256 amountInUsed) {
        IERC20(tokenIn).approve(router, 0);
        IERC20(tokenIn).approve(router, maxAmountIn);

        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = tokenOut;

        try IUniswapV2Router(router).swapTokensForExactTokens(
            amountOut,
            maxAmountIn,
            path,
            recipient,
            block.timestamp + DEFAULT_DEADLINE
        ) returns (uint256[] memory amounts) {
            amountInUsed = amounts[0];
            if (amountInUsed < maxAmountIn) {
                IERC20(tokenIn).safeTransfer(msg.sender, maxAmountIn - amountInUsed);
            }
        } catch Error(string memory reason) {
            revert(string(abi.encodePacked("Swap failed: ", reason)));
        } catch (bytes memory lowLevelData) {
            revert(string(abi.encodePacked("Swap failed: low-level error ", toHex(lowLevelData))));
        }
    }

    // --- Path-based ---

    function swapExactInputPath(
        address[] calldata path,
        uint256 amountIn,
        uint256 minAmountOut,
        address recipient,
        bytes calldata data
    ) external override returns (uint256 amountOut) {
        require(path.length >= 2, "Invalid path");

        IERC20(path[0]).approve(router, 0);
        IERC20(path[0]).approve(router, amountIn);

        uint256 deadline = _decodeDeadline(data);

        try IUniswapV2Router(router).swapExactTokensForTokens(
            amountIn,
            minAmountOut,
            path,
            recipient,
            deadline
        ) returns (uint256[] memory amounts) {
            amountOut = amounts[amounts.length - 1];
        } catch Error(string memory reason) {
            revert(string(abi.encodePacked("Swap path failed: ", reason)));
        } catch (bytes memory lowLevelData) {
            revert(string(abi.encodePacked("Swap path failed: low-level error ", toHex(lowLevelData))));
        }
    }

    function swapExactOutputPath(
        address[] calldata path,
        uint256 maxAmountIn,
        uint256 amountOut,
        address recipient,
        bytes calldata data
    ) external override returns (uint256 amountInUsed) {
        require(path.length >= 2, "Invalid path");

        IERC20(path[0]).approve(router, 0);
        IERC20(path[0]).approve(router, maxAmountIn);

        uint256 deadline = _decodeDeadline(data);

        try IUniswapV2Router(router).swapTokensForExactTokens(
            amountOut,
            maxAmountIn,
            path,
            recipient,
            deadline
        ) returns (uint256[] memory amounts) {
            amountInUsed = amounts[0];
            if (amountInUsed < maxAmountIn) {
                IERC20(path[0]).safeTransfer(msg.sender, maxAmountIn - amountInUsed);
            }
        } catch Error(string memory reason) {
            revert(string(abi.encodePacked("Swap path failed: ", reason)));
        } catch (bytes memory lowLevelData) {
            revert(string(abi.encodePacked("Swap path failed: low-level error ", toHex(lowLevelData))));
        }
    }

    // --- Helpers ---

    function _decodeDeadline(bytes memory data) internal view returns (uint256 deadline) {
        if (data.length == 32) {
            deadline = abi.decode(data, (uint256));
        } else {
            deadline = block.timestamp + DEFAULT_DEADLINE;
        }
    }

    function toHex(bytes memory data) internal pure returns (string memory) {
        bytes16 hexChars = "0123456789abcdef";
        bytes memory str = new bytes(2 + data.length * 2);
        str[0] = "0";
        str[1] = "x";
        for (uint256 i = 0; i < data.length; i++) {
            str[2 + i * 2] = hexChars[uint8(data[i] >> 4)];
            str[3 + i * 2] = hexChars[uint8(data[i] & 0x0f)];
        }
        return string(str);
    }
}

