// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

import "./ISwapAdapter.sol";
import "@uniswap/swap-router-contracts/contracts/interfaces/IV3SwapRouter.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract UniswapV3Adapter is ISwapAdapter {
    IV3SwapRouter public immutable router;
    uint256 public constant DEFAULT_DEADLINE = 300;

    constructor(address _router) {
        require(_router != address(0), "Invalid router");
        router = IV3SwapRouter(_router);
    }

    // --- Pair-based ---

    function swapExactInput(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut,
        address recipient,
        bytes calldata data
    ) external override returns (uint256 amountOut) {
        uint24 fee = abi.decode(data, (uint24));

        IERC20(tokenIn).approve(address(router), 0);
        IERC20(tokenIn).approve(address(router), amountIn);

        IV3SwapRouter.ExactInputSingleParams memory params = IV3SwapRouter.ExactInputSingleParams({
            tokenIn: tokenIn,
            tokenOut: tokenOut,
            fee: fee,
            recipient: recipient,
            amountIn: amountIn,
            amountOutMinimum: minAmountOut,
            sqrtPriceLimitX96: 0
        });

        amountOut = router.exactInputSingle(params);
    }

    function swapExactOutput(
        address tokenIn,
        address tokenOut,
        uint256 maxAmountIn,
        uint256 amountOut,
        address recipient,
        bytes calldata data
    ) external override returns (uint256 amountInUsed) {
        uint24 fee = abi.decode(data, (uint24));

        IERC20(tokenIn).approve(address(router), 0);
        IERC20(tokenIn).approve(address(router), maxAmountIn);

        IV3SwapRouter.ExactOutputSingleParams memory params = IV3SwapRouter.ExactOutputSingleParams({
            tokenIn: tokenIn,
            tokenOut: tokenOut,
            fee: fee,
            recipient: recipient,
            amountOut: amountOut,
            amountInMaximum: maxAmountIn,
            sqrtPriceLimitX96: 0
        });

        amountInUsed = router.exactOutputSingle(params);

        if (amountInUsed < maxAmountIn) {
            IERC20(tokenIn).transfer(msg.sender, maxAmountIn - amountInUsed);
        }
    }

    // --- Path-based ---

    function swapExactInputPath(
        address[] calldata path,
        uint256 amountIn,
        uint256 minAmountOut,
        address recipient,
        bytes calldata data
    ) external override returns (uint256 amountOut) {
        (uint24[] memory fees, uint256 deadline) = _decodePathData(data);
        require(path.length == fees.length + 1, "Path/fees mismatch");

        bytes memory encodedPath = _encodePath(path, fees);

        IERC20(path[0]).approve(address(router), 0);
        IERC20(path[0]).approve(address(router), amountIn);

        IV3SwapRouter.ExactInputParams memory params = IV3SwapRouter.ExactInputParams({
            path: encodedPath,
            recipient: recipient,
            amountIn: amountIn,
            amountOutMinimum: minAmountOut
        });

        amountOut = router.exactInput(params);
    }

    function swapExactOutputPath(
        address[] calldata path,
        uint256 maxAmountIn,
        uint256 amountOut,
        address recipient,
        bytes calldata data
    ) external override returns (uint256 amountInUsed) {
        (uint24[] memory fees, uint256 deadline) = _decodePathData(data);
        require(path.length == fees.length + 1, "Path/fees mismatch");

        bytes memory encodedPath = _encodePathReverse(path, fees);

        IERC20(path[0]).approve(address(router), 0);
        IERC20(path[0]).approve(address(router), maxAmountIn);

        IV3SwapRouter.ExactOutputParams memory params = IV3SwapRouter.ExactOutputParams({
            path: encodedPath,
            recipient: recipient,
            amountOut: amountOut,
            amountInMaximum: maxAmountIn
        });

        amountInUsed = router.exactOutput(params);

        if (amountInUsed < maxAmountIn) {
            IERC20(path[0]).transfer(msg.sender, maxAmountIn - amountInUsed);
        }
    }

    // --- Internal utilities ---

    function _encodePath(address[] memory path, uint24[] memory fees) internal pure returns (bytes memory) {
        bytes memory result;
        for (uint256 i = 0; i < fees.length; i++) {
            result = bytes.concat(result, abi.encodePacked(path[i], fees[i]));
        }
        result = bytes.concat(result, abi.encodePacked(path[path.length - 1]));
        return result;
    }

    function _encodePathReverse(address[] memory path, uint24[] memory fees) internal pure returns (bytes memory) {
        bytes memory result = abi.encodePacked(path[path.length - 1]);
        for (uint256 i = fees.length; i > 0; i--) {
            result = bytes.concat(result, abi.encodePacked(fees[i - 1], path[i - 1]));
        }
        return result;
    }

    function _decodePathData(bytes memory data) internal view returns (uint24[] memory fees, uint256 deadline) {
        if (data.length >= 96) {
            (fees, deadline) = abi.decode(data, (uint24[], uint256));
        } else if (data.length >= 64) {
            fees = abi.decode(data, (uint24[]));
            deadline = block.timestamp + DEFAULT_DEADLINE;
        } else {
            revert("Invalid adapter data");
        }
    }
}

